import React from "react";
import "./App.css";
import LoginPage from "./page/login/login";
import { Grid } from "@material-ui/core";

function App() {
  return (
    <Grid style={{ backgroundColor: "red" }}>
      <LoginPage />
    </Grid>
  );
}

export default App;
